	function Scan {
		param ($ESX)
		Write-Host "Scanning host $ESX"
		
		Echo Y | c:\Temp\plink.exe "$ESX" -pw "$($tb_ESXPASS.text)" -l "$($tb_ESXUser.text)" 'vsish -e get /memory/comprehensive' > c:\Temp\comprehensive.csv
		Echo Y | c:\Temp\plink.exe "$ESX" -pw "$($tb_ESXPASS.text)" -l "$($tb_ESXUser.text)" 'vsish -e get /memory/pshare/stats' > c:\Temp\pshare.csv
		
		#Pull Comprehensive Data
		$path = "C:\Temp\comprehensive.csv"
		Import-Csv $path | ForEach-Object {
			foreach ($property in $_.PSObject.Properties)
			{
				#Given to VMKernel:
				if ($property.value -like "*Given to VMKernel*")
				{
					$GiventoKernel = $property.value
					$GiventoKernel = $GiventoKernel.split(':')[1]
					$GiventoKernel = $GiventoKernel -replace 'kb'
					[long]$GiventoKernel = $GiventoKernel / 1048576
				}
				
				#Comprehensive FREE:
				if ($property.value -like "Free*")
				{
					$FREE = $property.value
					$FREE = $FREE.split(':')[1]
					$FREE = $FREE -replace 'kb'
					[long]$FREE = $FREE / 1048576
				}
			}
		}
		
		#Pull pshare
		$path = "C:\Temp\pshare.csv"
		Import-Csv $path | ForEach-Object {
			foreach ($property in $_.PSObject.Properties)
			{
				#MPNs Zero-pages:
				if ($property.value -like "*VM zero-pages *")
				{
					$MPNZeroPages = $property.value
					$MPNZeroPages = $MPNZeroPages.split(':')[1]
					if ($MPNZeroPages -gt 0)
					{
						[long]$MPNZeroPages = [long]$MPNZeroPages * 4
						[long]$MPNZeroPages = [long]$MPNZeroPages / 1048576
						
					}
				}
				
				#MPNs psharing VM memory:
				if ($property.value -like "*psharing VM memory*")
				{
					$MPNpSharing = $property.value
					$MPNpSharing = $MPNpSharing.split(':')[1]
					if ($MPNpSharing -gt 0)
					{
						[long]$MPNpSharing = [long]$MPNpSharing * 4
						[long]$MPNpSharing = [long]$MPNpSharing / 1048576
						
					}
				}
			}
		}
		
		#Remove-Item -Path c:\temp\comprehensive.csv -ErrorAction 'SilentlyContinue'
		#Remove-Item -Path c:\temp\pshare.csv -ErrorAction 'SilentlyContinue'
		$cluster = Get-VMHost -Name $ESX | get-cluster
		#Add-ListViewItem -ListView $listview1 -Items $ESX -SubItems (($giventokernel)/1048576), ((($MPNpSharing)*4096)/1048576), ((($MPNZeroPages)*4096)/1048576), ((($MPNpSharing-$MPNZeroPages)*4096)/1048576), (($FREE)/1048576)
		Add-ListViewItem -ListView $listview1 -Items $ESX -SubItems $cluster.name, ($giventokernel), ($MPNpSharing), ($MPNZeroPages), (($MPNpSharing - $MPNZeroPages)), (($FREE))
		
		$listview1.Columns[0].width = "-1"
		$listview1.Columns[1].width = "-2"
		$listview1.Columns[2].width = "-2"
		$listview1.Columns[3].width = "-2"
		$listview1.Columns[4].width = "-2"
		$listview1.Columns[5].width = "-2"
		$listview1.Columns[6].width = "-2"
		
		$listview1.Refresh()
		$textbox1.Text = "Connected"
		$textbox1.BackColor = 'Green'
	}
	
