	$btn_connect_Click = {
		$textbox1.BackColor = 'Yellow'
		$textbox1.Text = "Connecting..."
		$global:connected = Connect-VIServer -Server $tb_vcenter.Text -User $tb_user.Text -Password $tb_pass.text
