			$textbox1.Text = "connected"
			
			#scan
			$listview2.BeginUpdate()
			$listview2.Items.Clear()
			
			foreach ($cluster in (get-cluster))
			{
				$hosts = Get-Cluster -Name $cluster | Get-VMHost | Where { $_.PowerState -eq "PoweredOn" -and $_.ConnectionState -eq "Connected" }
				$listview2.Groups.Add("$($cluster.name)", "$($cluster.name)")
				
				foreach ($esx in $hosts)
				{
					#$cluster = Get-VMHost $esx | Get-Cluster
					$running = $esx | Get-VMHostService | where { $_.key -eq "TSM-SSH" }
					if ($running.running -eq $false)
					{
						$sshstatus = "Stopped"
					}
					else { $sshstatus = "Running" }
					
					Add-ListViewItem -ListView $listview2 -Group $listview2.Groups[$($cluster.name)] -Items $esx -SubItems $sshstatus
				}
			}
			$listview2.EndUpdate()
			$listview2.Columns[0].width = "-1"
			$listview2.Columns[1].width = "-2"
